const fields = [
    [
      {
        name: "firstName",
        label: "First Name",
        type: "input",
        inputProps: {
          autoCorrect: false
        }
      },
      {
        name: "lastName",
        label: "Last Name",
        type: "input",
        inputProps: {
          autoCorrect: false
        }
      }
    ],
    [
      {
        name: "email",
        label: "Email",
        type: "input",
        inputProps: {
          autoCorrect: false,
          autoCapitalize: "none",
          keyboardType: "email-address"
        }
      }
    ],
    [
      {
        name: "subject",
        placeholder: "Pick a topic of your interest",
        pickerItems: [
          {
            label: "React Native",
            value: 0
          },
