          {
            label: "React News",
            value: 3
          }
        ],
        type: "picker"
      }
    ],
    [
      {
        name: "password",
        label: "Password",
        type: "input",
        inputProps: {
          secureTextEntry: true
        }
      }
    ],
    [
      {
        name: "signUpButton",
        label: "Sign Up",
        type: "button"
      }
    ],
    [
      {
        name: "resetButton",
        label: "Reset",
        type: "button"
      }
    ]
  ];
